class Solution:
    def networkDelayTime(self, times: List[List[int]], n: int, k: int) -> int:
        graph = collections.defaultdict(list)
        for x,y,z in times:
            graph[x].append([y,z])

        visited = {}
        rest_set = set()
        queue = []

        for i in range(n):
            visited[i+1] = 101
            rest_set.add(i+1)

        print(graph)
        def bfs(distance:int, index:int):
            visited[index] = 0
            queue.append(index)

            while queue:
                parent_node =queue.pop(0)
                if parent_node in rest_set:
                    rest_set.remove(parent_node)
                else:
                    continue

                h = []
                #print(parent_node, graph)
                for current_node in list(graph[parent_node]):

                    visited[current_node[0]] = min(visited[parent_node] + current_node[1], visited[current_node[0]])


                for i in rest_set:
                    heapq.heappush(h, (visited[i], i))

                #print(visited,h, rest_set)
                if h:
                    min_val = h[0][0]
                #print(visited)
                while h:
                    if min_val == h[0][0]:
                        next_node = heapq.heappop(h)
                        queue.append(next_node[1])
                    else:
                        break

        bfs(0,k)
        print(visited)
        max_num = -1
        for i in visited:
            max_num = max(max_num, visited[i])
            if visited[i]  == 101:
                return -1
        return max_num

